import React from "react";
import NavBar from "./Navbar";
import { Grid, Typography } from "@mui/material";

export default function Home() {
  return (
    <div>
      <NavBar />
      <Grid
        container
        columnSpacing={{ md: 2 }}
        sx={{
          padding: "2em",
        }}
      >
        <Grid item xs={6}>
        <div className="login_box">

        </div>

        </Grid>
      </Grid>
    </div>
  );
}
